import React from "react";

// components

import CardLineChart from "components/Cards/CardLineChart.js";
import CardBarChart from "components/Cards/CardBarChart.js";
import CardPageVisits from "components/Cards/CardPageVisits.js";
import CardSocialTraffic from "components/Cards/CardSocialTraffic.js";
import NotificationDropdown from "components/NotificationDropdown.js"; // Importez le composant

export default function Dashboard() {
  return (
    <>
      <div className="flex flex-wrap">
        <div className="w-full xl:w-8/12 mb-12 xl:mb-0 px-4">
          <CardLineChart />
        </div>
        <div className="w-full xl:w-4/12 px-4">
          <CardBarChart />
        </div>
      </div>
      <div className="flex flex-wrap mt-4">
        <div className="w-full xl:w-8/12 mb-12 xl:mb-0 px-4">
          <CardPageVisits />
        </div>
        <div className="w-full xl:w-4/12 px-4">
          <CardSocialTraffic />
        </div>
      </div>
    </>
  );


  return (
    <div className="dashboard">
      {/* Barre de navigation */}
      <nav className="navbar">
        <div className="navbar-content">
          <h1>Tableau de bord</h1>
          <div className="navbar-actions">
            {/* Intégration du composant NotificationDropdown */}
            <NotificationDropdown />
          </div>
        </div>
      </nav>

      {/* Contenu principal du tableau de bord */}
      <div className="dashboard-content">
        <h2>Bienvenue sur votre tableau de bord</h2>
        <p>Ici, vous pouvez gérer vos réservations, consulter les notifications, et plus encore.</p>
        {/* Autres sections du tableau de bord */}
      </div>
    </div>
  );
};
